import './App.css';
import 'react-chatbox-component/dist/style.css';
import Register from './components/Register/Register'
import { BrowserRouter as Router, Route } from "react-router-dom";

const App =()=> {
  return (
      <Router>
        <div>
          <Route exact path="/register" component={Register} />
        </div>
      </Router>
  );
}

export default App;
